/**
 * @param {number[]} nums
 * @param {number} target
 * @return {number}
 */
var minSizeSubarray = function(nums, target) {
    let totalSum = nums.reduce((acc, val) => acc + val, 0);
    if (totalSum < target) return -1; // If total sum of nums is less than target, impossible to find a subarray

    let minLen = Infinity, sum = 0, start = 0;
    for (let end = 0; end < nums.length; end++) {
        sum += nums[end];
        while (sum >= target) {
            minLen = Math.min(minLen, end - start + 1);
            sum -= nums[start++];
        }
    }

    if (minLen === Infinity) return -1; // If no such subarray is found

    // Attempt to find a shorter subarray by wrapping around
    for (let end = 0; end < nums.length - 1; end++) {
        sum += nums[end];
        while (sum >= target) {
            minLen = Math.min(minLen, end + nums.length - start + 1);
            sum -= nums[start++ % nums.length];
        }
    }

    return minLen === Infinity ? -1 : minLen;
};
